sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

var res=JSON.parse(inputs.builder);
var arr=inputs.res2.res;

var array=[]
arr.forEach(function(element){
    var obj=
        {
          "rqmntsubctgycd": "REQ_SUB_CATEGORY1",
          "rqmntcd": element.reqcd,
          "rqmnttrnskey": element.reqtxnkey,
          "rqmntstatuscd": "REQSTATUS_5",
          "fulfillstatuscd": "FULFILSTATUS_2",
          "clntid": element.clientid,
          "documentdetails": {
            "doccd": "DOC_0787",
            "docuploadkeylist": [
              {
                "docuploadkey": element.capdocid,
                "upldstatuscd": "UPLOAD_DOC_STATUS_001"
              }
            ]
          }
    }
    array.push(obj);
})

res.body.fulfilrqmntreq.fulfilmntslist=array;

outputs.req=res;
})(inputs, outputs);

